window.bookSummaryJSON = "<p>The trials of Dr. Daniel Waterhouse and the Natural Philosophers increase one hundredfold in an England plagued by the impending war and royal insecurities, as the beautiful and ambitious Eliza plays a most dangerous game as double agent and confidante of enemy kings.</p> <p><i>The Baroque Cycle</i>, Neal Stephenson’s award-winning series, spans the late 17th and early 18th centuries, combining history, adventure, science, invention, piracy, and alchemy into one sweeping tale. It is a gloriously rich, entertaining, and endlessly inventive historical epic populated by the likes of Isaac Newton, William of Orange, Benjamin Franklin, and King Louis XIV, along with some of the most inventive literary characters in modern fiction. </p> <p>Audible’s complete and unabridged presentation of <i>The Baroque Cycle</i> was produced in cooperation with Neal Stephenson. Each volume includes an exclusive introduction read by the author.</p>"; 
